import React, {PureComponent} from 'react';
import frameStyle from './index.module.css';
import Logo from "../../components/Logo";
import Banner from "../../components/Banner";
import LoginPanel from "../../components/LoginPanel";
import Tipper from "../../components/Tipper";

class IndexFrame extends PureComponent {
    render() {
        return (
            <div className={frameStyle.frame}>
                <Logo/>
                <div className={frameStyle.panel}>
                    <Banner/>
                    <LoginPanel/>
                </div>
                <div className={frameStyle.lightSopt}>
                    <Tipper content={`飞云办公系统，集成了日常OA、商务邮箱、快文系统、财务报销、即时通讯、流程管理等办公应用于一体，打造全新一站式办公体验。&{<br>}
                    只需要一次登录，即可使用全部服务！`}
                            title='一站办公'/>
                    <Tipper content='支持windows、IOS、Andriod等多平台，所有数据自动同步，随时随地自由办公，再也不用担心错过重要信息'
                            title='多端协同'/>
                    <Tipper content='飞云办公系统，集成了日常OA、商务邮箱、快文系统、财务报销、即时通讯、流程管理等办公应用于一体，打造全新一站式办公体验，提高信息流转效率！'
                            title='千企互联'/>
                    <Tipper content='飞云办公系统，集成了日常OA、商务邮箱、快文系统、财务报销、即时通讯、流程管理等办公应用于一体，打造全新一站式办公体验，提高信息流转效率！'
                            title='优势一'/>
                    <Tipper content='飞云办公系统，集成了日常OA、商务邮箱、快文系统、财务报销、即时通讯、流程管理等办公应用于一体，打造全新一站式办公体验，提高信息流转效率！'
                            title='优势一'/>
                </div>
            </div>
        );
    }
}

export default IndexFrame;
